import './consumer-with-dock-opened.css';
import React from 'react'
import { Link } from "react-router-dom";
import BalloonWrenchButton from '../../buttons/mac-bar/balloon-wrench-button/balloon-wrench-button';
import TwirlButton from '../../buttons/mac-bar/twirl-button/twirl-button';
import NavButton from '../../buttons/mac-bar/nav-button/nav-button';
import NextTemplateButton from '../../buttons/mac-bar/next-template-button/next-template-button';
import PreviousTemplateButton from '../../buttons/mac-bar/previous-template-button/previous-template-button';
import HistoryButton from '../../buttons/mac-bar/history-button/history-button';
import MenuOverflowButton from '../../buttons/mac-bar/menu-overflow/menu-overflow';

function ConsumerWithDockOpened() {
    function handleClick() {
    console.log('handleClick for consumer dock Called');
        // Routing logic to take you to the treeView
    }


    // Here is where you import the buttons for the apps, preferably in svg format.
    return (


        <div className="button-container2">
        <Link to="/Consumer">
        <BalloonWrenchButton></BalloonWrenchButton>
        <TwirlButton></TwirlButton>
        <NavButton></NavButton>
        <PreviousTemplateButton></PreviousTemplateButton>
        <NextTemplateButton></NextTemplateButton>
        <HistoryButton></HistoryButton>
        <MenuOverflowButton></MenuOverflowButton>
        <button onClick={handleClick} className="button-child">Refresh</button>
        </Link>
        </div>



    );
  }

  export default ConsumerWithDockOpened;
